const StoryWatch = ({ video }) => {

    const [videoIndex, setVideoIndex] = useState(0);

    return (
      <div className="story__watch">
        <video controls>
            <source src={video[videoIndex].filename} />
        </video>
      </div>
    );
  };

  export default StoryWatch;
